Paruchów is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20%C5%BBerk%C3%B3w"&gt;Gmina Żerków&lt;/a&gt;, within &lt;a href="Jarocin%20County"&gt;Jarocin County&lt;/a&gt;, &lt;a href="Greater%20Poland%20Voivodeship"&gt;Greater Poland Voivodeship&lt;/a&gt;, in west-central Poland. It lies approximately north-east of &lt;a href="%C5%BBerk%C3%B3w"&gt;Żerków&lt;/a&gt;, north-east of &lt;a href="Jarocin"&gt;Jarocin&lt;/a&gt;, and south-east of the regional capital &lt;a href="Pozna%C5%84"&gt;Poznań&lt;/a&gt;.
